import { Container, makeStyles } from "@material-ui/core"

const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: theme.spacing(4),
  },
}))

const Feed = () => {
  const classes = useStyles()
  return (
    <Container className={classes.container} maxWidth="lg">
      <h1>Hey</h1>
    </Container>
  )
}

export default Feed
